import {GET_USER_BY_ID} from '../constants/actionTypes';

const profileReducer = (state = { userData: [] }, action) => {
    switch (action.type) {
        case GET_USER_BY_ID:
            alert('hi')
            console.log(action.payload.userData)
            return { ...state, userData: action.payload.userData };
        default:
            return state;
    }
}

export default profileReducer;
